import React from 'react'


class LogoContainer extends React.Component {
render(){
    return(

        <div className="container">
            <div className="row justify-content-center">
                <div className="col-6">
                <div class="triangle-down"></div>
                </div>
            </div>
        </div>

    )
}
}

export default LogoContainer
